# OEIS sequence: A372403

from math import isqrt
from sympy import mobius, nextprime, integer_log
def A372403(n):
    m, p = (1<<n)-1, 2
    q = isqrt(m)
    r = m-sum(mobius(k)*(m//k**2) for k in range(1,q+1))
    while p<=q:
        r -= integer_log(m,p)[0]-1
        p = nextprime(p)
    return r # _Chai Wah Wu_, Jun 10 2024

